import fetch from 'isomorphic-fetch'

export function postContact (...body) {
    console.log('test', JSON.stringify(), body);

    return fetch("http://localhost:3000/test/api/auth/contact", {
        method: 'POST',
        headers: {
            'Accept': 'application/json',
        },
        body: JSON.stringify(body)
    }).then(function (response) {
        if (response.status != 200) {
            dispatch(setError(response.status + '===>' + response.statusText + '===>' + response.url))
        }
        return response.json();
    }).then(function (json) {
        dispatch(setData(json, q))
    }).catch(function(err){
        console.log(err);
    });
}
